import React, { Component } from 'react';
import axios from 'axios';


export default class Accueil extends Component {

    constructor(props) {
        super(props);
        this.state = { profil: [] };

    }
    componentDidMount() {
        axios.get('http://localhost:8080/article')
            .then(response => {
                console.log('i am a response', response)
                this.setState({ profil: response.data });
            })
            .catch(function (error) {
                console.log(error);
            })



    }

    liste() {
        return <div>
            <div className="table-responsive">
                <table className="table">
                    <thead>
                        <tr>
                            <p>IDUTILISATEUR</p>
                            <th>ARTICLE</th>
                            <th>PHOTOS</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                            (this.state.profil.length > 0) ? (this.state.profil.map((obj) => {
                                return <tr key={obj._id}>
                                     <td>{obj._id}</td>
                                    <td>{obj.idutilisateur}</td>
                                    <td>{obj.article}</td>  
                                    <td><img width='140px' height='150px' src={'http://localhost:8080/article'+obj.image} alt='photo'/></td>                                 
                                    {console.log(obj)}
                                </tr>

                            })) : ('')
                        }
                    </tbody>
                </table>
            </div>
        </div>
    }
    render() {
        return (
            <div>
                {this.liste()}
            </div>
        );
    }
}
